import logo from './logo.svg';
import './App.css';
import React from 'react';
import Login_page from './COMPONENT/login';
import Profile from './COMPONENT/profile';
import Note_book from './COMPONENT/notebook';
import Home from './COMPONENT/home';
import SignIn from './COMPONENT/signin';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="App">
      {/* <Note_book/>  */}
      <Switch>
          <Route path="/profile">
            <Profile />
          </Route>
          <Route path="/notebook">
            <Note_book />
          </Route>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/login">
            <Login_page />
          </Route>
          <Route path="/signin">
            <SignIn />
          </Route>
        </Switch>
      <Home/>
    </div>
    </Router>
  );
}

export default App;
